  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetric Terrain Models (BTMs) of seafloor
  morphology are an important component of marine geological investigations. Advances
  in acquisition and processing technologies of bathymetry data have facilitated the
  creation of high-resolution bathymetric surfaces that approach the resolution of
  those available for onshore investigations. These BTMs provide a detailed representation
  of the Earth's subaqueous surface and when combined with other geophysical and geologic
  datasets, allow for interpretation of modern and ancient geologic processes.\",\n\t\"license_title\":
